import axios from"axios";export const SERVER_ROOT="http://localhost:5000/";export const LOGIN_URL=SERVER_ROOT+"api/v1/users/login";export const REGISTER_URL="api/auth/register";export const REQUEST_PASSWORD_URL="api/auth/forgot-password";export const ME_URL="api/me";export function login(email,password){console.log(LOGIN_URL),axios.post(LOGIN_URL,{email:email,password:password}).then(response=>{console.log(response.data)})};export function register(email,fullname,username,password){return axios.post(REGISTER_URL,{email:email,fullname:fullname,username:username,password:password})};export function requestPassword(email){return axios.post(REQUEST_PASSWORD_URL,{email:email})};export function getUserByToken(){return axios.get(ME_URL)};